import React from "react";
import { Navigate, Route, Outlet } from "react-router-dom";
export default function PrivateRoute() {
  let auth = { token: false };
  return (
    <Route>
      auth.token?
      <Outlet />:<Navigate to="/login"></Navigate>
    </Route>
  );
}
